import React, { Component } from 'react';

class Linker extends Component {
    render() { 
        return (
        <div className='linkers'>
            <ul>
                <li><a href="https://training.zuri.team/" id='btn_zuri' title=''>Zuri Team</a></li>
                <li><a href=" http://books.zuri.team" id='books'>Zuri Books</a></li>
                <li><a href="https://books.zuri.team/python-for-beginners?ref_id=<Austyno>" id='book_python'>Python Books</a></li>
                <li><a href="https://background.zuri.team" id='pitch'>Background Check For Codes</a></li>
                <li><a href="https://books.zuri.team/design-rules" id='book_design'>Design Books</a></li>
            </ul>
        </div>
        );
    }
}
 
export default Linker;
